1º) Bolsonaro RESPEITA à LIBERDADE de IMPRENSA (nunca mandou CENSURAR NENHUM JORNAL, mesmo recebendo muitos insultos INJUSTOS por parte de alguns); 

2º) Bolsonaro retirou IMPOSTOS FEDERAIS SOB PARTE DOS COMBUSTÍVEIS e OUTROS PRODUTOS. HOJE temos combustíveis mais baratos, (Ele juntamente com Paulo Guedes, estão lutando para baixar impostos e com muita inteligência, isso NÃO atrapalha em nada o arrecadamento, pois a economia se mantém ativa e isso contrapõe a retirada dos impostos);

 3º) Bolsonaro, PERDOOU A DÍVIDA DO FIES DOS JOVENS UNIVERSITÁRIOS (os Jovens acadêmicos estavam ATOLADOS em dívidas com o FIES, devido aos altos juros. Seria muito difícil a eles honrarem com o pagamento desta dívida. BOLSONARO perdoou esta dívida dos jovens e os LIBERTOU). 

4º) Veja todas as obras de INFRAESTRUTURA finalizadas e ENTREGUES em todo o país, INCLUINDO ÁGUA P/ O NORDESTE, que o nosso MINISTRO TARCÍSIO, realizou. (Ministro Tarcísio foi escolhido por BOLSONARO);
